INGREDIENTS
ğŸŒ¿2 pounds lean ground beef
ğŸŒ¿1 Tablespoon burger seasoning
ğŸŒ¿Â½ teaspoon garlic powder
ğŸŒ¿Â¼ teaspoon paprika
ğŸŒ¿Â¼ teaspoon seasoned salt
ğŸŒ¿Â½ teaspoon liquid smoke
ğŸŒ¿Â½ teaspoon extra virgin olive oil
ğŸŒ¿2 Tablespoons Worcestershire
ğŸŒ¿1 Tablespoon A1 steak sauce
ğŸŒ¿1 Tablespoon BBQ sauce
ğŸŒ¿Â½ teaspoon Dijon mustard
ğŸŒ¿2 Tablespoons beer
ğŸŒ¿3 slices cheese, cut into fourths
ğŸŒ¿6 burger buns

INSTRUCTIONS
1. In a medium bowl, combine all the ingredients except for the ground beef and cheese (everything listed starting with the burger seasoning down to the beer). Whisk together until well combined. Add the ground beef to the wet mixture and gently combine with your hands until everything is well mixed.
2. Stack 3 pieces of sliced cheese and cut into fourths, making 12 total cheese squares.
3. Make 12 balls of meat (slightly larger than the size of a golf ball). To make one burger, flatten one ball of meat, then top with two cheese squares. Take a second ball of meat and flatten on top of cheese. Pinch the edges together to make one stuffed patty. Put a small dent in the center of each burger with your thumb to keep the burger flat while cooking.
4. To cook, set your grill to 400 degrees fahrenheit. Cook for roughly 5 minutes on each side. This will make a medium to medium-well burger. But cook to your liking. Top with cheese for the last few minutes (optional).
5. Serve on burger buns with condiments and toppings of your choice.";}i:56;a:1:{s:14:"comments_count";i:1;}i:57;a:1:{s:11:"likes_count";i:2;}i:58;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEujW1th-v1";}i:59;a:1:{s:5:"image";s:260:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118748946_3392344384138233_2551301608708627868_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=6ggXRuw8dKUAX-DCUX3&_nc_tp=15&oh=993dbd76c4e99584d08c86e5e3c22aab&oe=5F7B6B4F";}i:60;a:1:{s:4:"type";s:5:"image";}i:61;a:1:{s:8:"owner_id";i:19264484;}i:62;a:1:{s:14:"owner_username";s:0:"";}i:63;a:1:{s:14:"owner_fullname";s:0:"";}i:64;a:1:{s:9:"owner_pic";s:0:"";}i:65;a:1:{s:2:"id";s:19:"2391003668483611144";}i:66;a:1:{s:10:"short_code";s:11:"CEujSscnxoI";}i:67;a:1:{s:12:"created_time";i:1599249870;}i:68;a:1:{s:7:"caption";s:234:"If I was craving to double fist ramen at 3am I would simply just go to @kazramen because theyâ€™re open 24hours. (also bc highkey their tonkatsu is bomb af)
